import React from "react";
import { Grid } from "@material-ui/core";

function Details() {
  return (
    <div>
      <div className="details-container">
        <Grid container>
          <Grid item md={6}>
            <h2>Who can participate?</h2>
            <p>Registration is open to the public, but we will give priority to UCSD students.</p>
          </Grid>
        </Grid>
      </div>
    </div>
  ); 
}

export default Details;
